import React, { useState, useEffect } from "react";
import { Routes, Route, Navigate, useNavigate, Link, useLocation } from "react-router-dom";
import { motion } from "framer-motion";
import { 
  LayoutDashboard, 
  MessageSquare, 
  FileText, 
  FolderOpen, 
  Star, 
  LogOut,
  User,
  Menu,
  X
} from "lucide-react";

// Import admin components
import AdminLogin from "./AdminLogin";
import AdminOverview from "./AdminOverview";
import ContactSubmissions from "./ContactSubmissions";
import QuotationManager from "./QuotationManager";
import ProjectManager from "./ProjectManager";
import TestimonialManager from "./TestimonialManager";

const AdminDashboard = () => {
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [adminToken, setAdminToken] = useState(null);
  const [sidebarOpen, setSidebarOpen] = useState(false);
  const navigate = useNavigate();
  const location = useLocation();

  useEffect(() => {
    // Check for existing token in localStorage
    const token = localStorage.getItem('adminToken');
    if (token) {
      setAdminToken(token);
      setIsAuthenticated(true);
    }
  }, []);

  const handleLogin = (token) => {
    localStorage.setItem('adminToken', token);
    setAdminToken(token);
    setIsAuthenticated(true);
    navigate('/admin/overview');
  };

  const handleLogout = () => {
    localStorage.removeItem('adminToken');
    setAdminToken(null);
    setIsAuthenticated(false);
    navigate('/admin/login');
  };

  const menuItems = [
    { 
      path: '/admin/overview', 
      label: 'Overview', 
      icon: LayoutDashboard,
      description: 'Dashboard summary'
    },
    { 
      path: '/admin/contacts', 
      label: 'Contact Submissions', 
      icon: MessageSquare,
      description: 'Manage contact forms'
    },
    { 
      path: '/admin/quotations', 
      label: 'Quotations', 
      icon: FileText,
      description: 'Create & manage quotes'
    },
    { 
      path: '/admin/projects', 
      label: 'Projects', 
      icon: FolderOpen,
      description: 'Portfolio management'
    },
    { 
      path: '/admin/testimonials', 
      label: 'Testimonials', 
      icon: Star,
      description: 'Client reviews'
    }
  ];

  if (!isAuthenticated) {
    return <AdminLogin onLogin={handleLogin} />;
  }

  return (
    <div className="min-h-screen bg-slate-50">
      {/* Mobile sidebar backdrop */}
      {sidebarOpen && (
        <div 
          className="lg:hidden fixed inset-0 z-20 bg-black/50"
          onClick={() => setSidebarOpen(false)}
        />
      )}

      {/* Sidebar */}
      <div className={`
        fixed top-0 left-0 h-full w-64 bg-white border-r border-slate-200 z-30 transform transition-transform duration-300
        ${sidebarOpen ? 'translate-x-0' : '-translate-x-full lg:translate-x-0'}
      `}>
        <div className="flex flex-col h-full">
          {/* Header */}
          <div className="p-6 border-b border-slate-200">
            <div className="flex items-center justify-between">
              <div className="flex items-center space-x-3">
                <div className="w-10 h-10 bg-slate-900 rounded-lg flex items-center justify-center">
                  <User className="w-6 h-6 text-white" />
                </div>
                <div>
                  <h2 className="font-semibold text-slate-900">Admin Panel</h2>
                  <p className="text-xs text-slate-500">Netrik Techworks</p>
                </div>
              </div>
              <button
                onClick={() => setSidebarOpen(false)}
                className="lg:hidden p-1 rounded-md hover:bg-slate-100"
              >
                <X className="w-5 h-5" />
              </button>
            </div>
          </div>

          {/* Navigation */}
          <nav className="flex-1 p-4 space-y-2">
            {menuItems.map((item) => {
              const Icon = item.icon;
              const isActive = location.pathname === item.path;
              
              return (
                <Link
                  key={item.path}
                  to={item.path}
                  onClick={() => setSidebarOpen(false)}
                  className={`
                    flex items-center space-x-3 px-4 py-3 rounded-lg transition-all duration-200
                    ${isActive 
                      ? 'bg-slate-900 text-white shadow-lg' 
                      : 'text-slate-700 hover:bg-slate-100 hover:text-slate-900'
                    }
                  `}
                >
                  <Icon className="w-5 h-5" />
                  <div>
                    <div className="font-medium">{item.label}</div>
                    <div className="text-xs opacity-75">{item.description}</div>
                  </div>
                </Link>
              );
            })}
          </nav>

          {/* Logout */}
          <div className="p-4 border-t border-slate-200">
            <button
              onClick={handleLogout}
              className="w-full flex items-center space-x-3 px-4 py-3 text-red-600 hover:bg-red-50 rounded-lg transition-colors"
            >
              <LogOut className="w-5 h-5" />
              <span className="font-medium">Logout</span>
            </button>
          </div>
        </div>
      </div>

      {/* Main content */}
      <div className="lg:ml-64">
        {/* Top bar */}
        <div className="bg-white border-b border-slate-200 px-6 py-4">
          <div className="flex items-center justify-between">
            <div className="flex items-center space-x-4">
              <button
                onClick={() => setSidebarOpen(true)}
                className="lg:hidden p-2 rounded-md hover:bg-slate-100"
              >
                <Menu className="w-5 h-5" />
              </button>
              
              <div>
                <h1 className="text-2xl font-bold text-slate-900">
                  {menuItems.find(item => item.path === location.pathname)?.label || 'Admin Dashboard'}
                </h1>
                <p className="text-sm text-slate-500">
                  {menuItems.find(item => item.path === location.pathname)?.description || 'Manage your website'}
                </p>
              </div>
            </div>

            <div className="flex items-center space-x-4">
              <Link
                to="/"
                className="px-4 py-2 text-slate-600 hover:text-slate-900 transition-colors"
              >
                View Website
              </Link>
            </div>
          </div>
        </div>

        {/* Page content */}
        <div className="p-6">
          <motion.div
            key={location.pathname}
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            exit={{ opacity: 0, y: -20 }}
            transition={{ duration: 0.3 }}
          >
            <Routes>
              <Route path="/" element={<Navigate to="/admin/overview" replace />} />
              <Route path="/login" element={<Navigate to="/admin/overview" replace />} />
              <Route 
                path="/overview" 
                element={<AdminOverview adminToken={adminToken} />} 
              />
              <Route 
                path="/contacts" 
                element={<ContactSubmissions adminToken={adminToken} />} 
              />
              <Route 
                path="/quotations" 
                element={<QuotationManager adminToken={adminToken} />} 
              />
              <Route 
                path="/projects" 
                element={<ProjectManager adminToken={adminToken} />} 
              />
              <Route 
                path="/testimonials" 
                element={<TestimonialManager adminToken={adminToken} />} 
              />
            </Routes>
          </motion.div>
        </div>
      </div>
    </div>
  );
};

export default AdminDashboard;
